import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import WelcomePage         from './WelcomePage';
import RegisterPage        from './RegisterPage';
import EmailInputPage      from './EmailInputPage';
import ConfirmCodePage     from './ConfirmCodePage';
import MainMenu            from './MainMenu';
import PollsPage           from './PollsPage';
import AssessmentPage      from './AssessmentPage';
import FeedbackPage        from './FeedbackPage';
import ProfilePage         from './ProfilePage';
import EmployeePage        from './EmployeePage';
import JustincasePage      from './JustincasePage';
import FirstDayAdaptation  from './FirstDayAdaptation';
import ZnakomstvoPage      from './ZnakomstvoPage';
import NameInputPage       from './NameInputPage';
import QuestionsPage       from './QuestionsPage';
import ThankYouPage        from './ThankYouPage';
import MarzaPollPage       from './MarzaPollPage';
import SNPPage             from './SNPPage';
import './index.css';

function MainApp() {
  return (
    <div className="app-container">
      <Router>
        <Routes>
          <Route path="/"                    element={<WelcomePage />} />
          <Route path="/register"            element={<RegisterPage />} />
          <Route path="/email-input"         element={<EmailInputPage />} />
          <Route path="/confirm-code"        element={<ConfirmCodePage />} />
          <Route path="/main-menu"           element={<MainMenu />} />
          <Route path="/polls"               element={<PollsPage />} />
          <Route path="/snp"                 element={<SNPPage />} />
          <Route path="/employee"            element={<EmployeePage />} />
          <Route path="/assessment"          element={<AssessmentPage />} />
          <Route path="/feedback"            element={<FeedbackPage />} />
          <Route path="/profile"             element={<ProfilePage />} />
          <Route path="/justincase"          element={<JustincasePage />} />
          {/* AdaptationPage полностью удалён */}
          <Route path="/FirstDayAdaptation"  element={<FirstDayAdaptation />} />
          <Route path="/znakomstvo"          element={<ZnakomstvoPage />} />
          <Route path="/name-input"          element={<NameInputPage />} />
          <Route path="/questions"           element={<QuestionsPage />} />
          <Route path="/thankyou"            element={<ThankYouPage />} />
          <Route path="/marzapoll"           element={<MarzaPollPage />} />
        </Routes>
      </Router>
    </div>
  );
}

export default MainApp;
